  text:
    text: "<p><b>FenTech Incorporated</b> is a company active in the areas of bioengineering\
      \ and chemical enhancements.\n</p><p>FenTech aims to enhance regular <a href=\"\
      /Humans\" title=\"Humans\">human</a> individuals far beyond their natural limits,\
      \ using technologies such as: adrenaline stimulants, synaptic catalysts, and\
      \ impulse regulators.\n</p>\n<h2><span class=\"mw-headline\" id=\"Products\"\
