      Malcolm\">Malcolm</a></div></div></div>\n<p>One of FenTech's prototypes is <a\
      \ href=\"/Venom#Zanna\" title=\"Venom\">Zanna</a>, a chem warrior who entered\
      \ into the <a href=\"/Liandri_Grand_Tournament\" title=\"Liandri Grand Tournament\"\
