      \ title=\"Venom\">Venom</a>. She appears in <a href=\"/Unreal_Tournament\" title=\"\
      Unreal Tournament\">Unreal Tournament</a>.\n</p><p>FenTech's finest creation\
      \ is <a href=\"/Malcolm\" title=\"Malcolm\">Malcolm</a>, a superhuman killing\
      \ machine who became famous by defeating former champion <a href=\"/Xan_Kriegor\"\
      \ title=\"Xan Kriegor\">Xan Kriegor</a> in the Liandri Grand Tournament. He\
      \ won the Tournament at least nine times, and has appeared in all Unreal Tournament\
